import React from "react";

function Paused({ isTimerRunning }) {
  console.log("HERE:", isTimerRunning);

  if (!isTimerRunning) {
    return (
			<div className="row mb-2 d-block" id="paused">
				<div className="col">
					<h3>PAUSED</h3>
				</div>
			</div>
		);;
  } else {
    return null;
  }
}
export default Paused;
